import React from 'react'
import API from './api'
import 'react-date-range/dist/styles.css' // main style file
import 'react-date-range/dist/theme/default.css' // theme css file
import {DateRangePicker} from 'react-date-range'
import {AppBar, Paper, Typography, Button, Toolbar} from '@material-ui/core'
import Autocomplete from '@material-ui/lab/Autocomplete'
import TextField from '@material-ui/core/TextField'
import Slider from '@material-ui/core/Slider'

class App extends React.Component {
	state = {
		tags: [],
		isSearchClicked: false,
		trips: []
	}

	onAddTag = tag => {
		const newTags = this.state.tags.concat(tag)
		this.setState({tags: newTags})
	}

	onDeleteTag = tag => {
		const newTags = this.state.tags.filter(elem => elem !== tag)
		this.setState({tags: newTags})
	}

	handleOpenResult = () => {
		this.setState({isSearchClicked: true})
	}

	getTrips = async (by = 'PRICE', order = 'ASCENDING') => {
		try {
			const trips = await API.getTripsApi(by, order)
			if (Array.isArray(trips)) {
				this.setState({trips})
			}
		} catch (error) {
			console.log({error})
		}
	}
	allTags = []

	async componentDidMount() {
		let tag = await API.getAllTags()
		let cnt = await API.getAllCountries()
		console.log(this.setState({...this.state, tags: tag, countries: cnt}))
	}

	constructor() {
		super()
		this.state = {
			tags: [],
			countries: [],
			value: [1000, 2000]
		}
	}

	render() {
		const selectionRange = {
			startDate: new Date(),
			endDate: new Date(),
			key: 'selection'
		}

		function handleSelect(ranges) {
			console.log(ranges)
			selectionRange.endDate = ranges.selection.endDate
			selectionRange.startDate = ranges.selection.startDate
		}

		function handleChange(event, newValue) {
			this.state = {...this.state, value: newValue}
			console.log(this.state.value, newValue)
		}

		function valuetext(value) {
			return `${value}$`
		}

		return (
			<div id="App">
				<AppBar className={'root'}>
					<Toolbar>
						<Typography variant="h6" className={'title'}>
							Travel Agency
						</Typography>
						<Button color="inherit" variant={'outlined'}>Admin</Button>
					</Toolbar>
				</AppBar>
				<Paper elevation={3} variant={'outlined'} className={'main'}>
					<div className="filter">
						<span id={'filter'}>Filter</span>
						<span className={'select-data'}>Select data range:</span>
						<div className={'date'}>
							<DateRangePicker
								editableDateInputs={true}
								ranges={[selectionRange]}
								onChange={handleSelect}
								moveRangeOnFirstSelection={false}
							/>
							<div className="params">
								<Autocomplete
									multiple
									id="tags-standard"
									options={this.state.tags}
									getOptionLabel={(option) => option.title}
									renderInput={(params) => (
										<TextField
											{...params}
											variant="standard"
											label="Select tags"
											placeholder="Tags"
										/>
									)}
								/>
								<span className={'spacer'}/>
								<Autocomplete
									multiple
									id="cntrs-standard"
									options={this.state.countries}
									getOptionLabel={(option) => option.title}
									renderInput={(params) => (
										<TextField
											{...params}
											variant="standard"
											label="Select countries"
											placeholder="Countries"
										/>
									)}
								/>
								<span className="spacer"/>
								<div>
									<Typography id="range-slider" gutterBottom>
										Price range
									</Typography>
									<Slider
										value={this.state.value}
										min={0}
										max={5000}
										onChange={handleChange}
										valueLabelDisplay="auto"
										aria-labelledby="range-slider"
										getAriaValueText={valuetext}
									/>
								</div>
								{/*<ChipInput*/}
								{/*	value={tags}*/}
								{/*	onAdd={(chip) => handleAddChip(chip)}*/}
								{/*	onDelete={(chip, index) => handleDeleteChip(chip, index)}*/}
								{/*	dataSource={allTags}*/}
								{/*	helperText={'Select Tags'}*/}

								{/*/>*/}
							</div>

						</div>
					</div>
				</Paper>
				<Paper className={'result'} variant={'outlined'} elevation={2}>

				</Paper>
			</div>
		)
	}
}

export default App
